import { createSlice } from '@reduxjs/toolkit'
import react from "react"
const getData = () => {
  fetch('data.json')
  .then(res=>res.json())
  return
}
const initialState = ""

export const counterSlice = createSlice({
  name: 'counter',
  initialState
})

export default counterSlice.reducer
